import React, { useRef } from "react";
import "./Work.css";

function Work() {
  const scrollRef = useRef(null);

  const scroll = (direction) => {
    if (scrollRef.current) {
      const { scrollLeft, clientWidth } = scrollRef.current;
      const scrollAmount = clientWidth * 0.8; // scroll 80% of container width
      if (direction === "left") {
        scrollRef.current.scrollTo({
          left: scrollLeft - scrollAmount,
          behavior: "smooth",
        });
      } else {
        scrollRef.current.scrollTo({
          left: scrollLeft + scrollAmount,
          behavior: "smooth",
        });
      }
    }
  };

  const cardsData = [
    {
      title: "AcheAlguem",
      description: "Register and locate missing persons",
      tags: ["NextJS", "Typescript", "2025"],
      link: "https://achealguem.com.br/",
      imgSrc: "/images/ache.png",
    },
    {
      title: "Project 2",
      description: "Description of project 2",
      tags: ["React", "JS", "2024"],
      link: "#",
      imgSrc: "/images/project2.png",
    },
    {
      title: "Project 3",
      description: "Description of project 3",
      tags: ["NodeJS", "Express", "2023"],
      link: "#",
      imgSrc: "/images/project3.png",
    },
    {
      title: "Project 4",
      description: "Description of project 4",
      tags: ["Vue", "Vuex", "2025"],
      link: "#",
      imgSrc: "/images/project4.png",
    },
    {
      title: "Project 5",
      description: "Description of project 5",
      tags: ["Angular", "TS", "2022"],
      link: "#",
      imgSrc: "/images/project5.png",
    },
  ];

  return (
    <div className="work-container">
      <h2>My Work</h2>
      <div className="carousel-wrapper">
        <button
          aria-label="Scroll Left"
          className="scroll-button left"
          onClick={() => scroll("left")}
        >
          &#8592;
        </button>
        <div
          role="group"
          aria-roledescription="slide"
          className="cards-row"
          ref={scrollRef}
        >
          {cardsData.map(({ title, description, tags, link, imgSrc }, idx) => (
            <a
              href={link}
              target="_blank"
              rel="noopener noreferrer"
              className="ache-card-link"
              tabIndex={0}
              key={idx}
            >
              <div className="ache-card">
                <div className="ache-image-wrapper">
                  <img
                    alt={title}
                    loading="lazy"
                    decoding="async"
                    src={imgSrc}
                    className="ache-image"
                  />
                </div>
                <div className="ache-content">
                  <div>
                    <h3 className="ache-title">{title}</h3>
                    <p className="ache-description">{description}</p>
                    <div className="ache-tags">
                      {tags.map((tag, i) => (
                        <span className="ache-tag" key={i}>
                          {tag}
                        </span>
                      ))}
                    </div>
                  </div>
                  <div className="ache-icon">
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="24"
                      height="24"
                      viewBox="0 0 24 24"
                      fill="none"
                      stroke="currentColor"
                      strokeWidth="2"
                      strokeLinecap="round"
                      strokeLinejoin="round"
                      className="arrow-icon"
                      aria-hidden="true"
                    >
                      <path d="M7 7h10v10"></path>
                      <path d="M7 17 17 7"></path>
                    </svg>
                  </div>
                </div>
              </div>
            </a>
          ))}
        </div>
        <button
          aria-label="Scroll Right"
          className="scroll-button right"
          onClick={() => scroll("right")}
        >
          &#8594;
        </button>
      </div>
    </div>
  );
}

export default Work;
